import React from 'react'

import PropTypes from 'prop-types'

import './outline-button.css'

const OutlineButton = (props) => {
  return (
    <div className={`outline-button-container ${props.rootClassName} `}>
     <a href={props.apkUrl} download>  <button className="outline-button-button button" disabled={props.disabled}>{props.button1}</button>
     </a>
    </div>
  )
}

OutlineButton.defaultProps = {
  rootClassName: '',
  button1: 'Button',
  disabled: false,
   apkUrl: null
}

OutlineButton.propTypes = {
  rootClassName: PropTypes.string,
  button1: PropTypes.string,
  disabled: PropTypes.bool,
  apkUrl: PropTypes.string
}

export default OutlineButton
